import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from "./components/Home"; // Replace 'Home' with your actual component path
import CreateShoppingList from "./components/CreateShoppingList"; // Replace 'CreateShoppingList' with your actual component path
import SavedLists from "./SavedLists"; // Replace 'SavedLists' with your actual component path

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/create" component={CreateShoppingList} />
        <Route path="/saved" component={SavedLists} />
      </Switch>
    </Router>
  );
};

export default App;
